package javawrapperclass;

public class Sample1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		//Primitive DataType
		int number ;
		
		//Integer DataType
		Integer number1;
		
		number1 = 200;
		
		//Auto Boxing : Converting Primitive int to Integer Object.
		number = number1;
		
		System.out.println("The primitive int is: " +number);
		System.out.println("The primitive int is: " +number1);
		

	}

}
